import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';



/**
* Renders a second navbar continaing the sub nav bar items of the main navbar item
* Renders a table with four columns: "Account Name", "Account Number", "Balanace", and "Avaliable Balance".
* The "data" property (this.props.data) returns the actual data in the table
**/


class newAccounts extends Component {
  render () {
  return (
    <div>
      <div className = 'navbar2'>
        <NavLink to="/MyAccounts" className = "navButton"> My Accounts </NavLink>
        <NavLink to="/newAccounts" className = "navButton"> New Accounts </NavLink>
        <NavLink to="/detailedBalance" className = "navButton"> Detailed Balance </NavLink>
        <NavLink to="/myCards" className = "navButton"> My Cards </NavLink>
        <NavLink to="/accountInformation" className = "navButton"> Account Information </NavLink>
      </div>
      <h1>New Accounts</h1>
    </div>

  )
}
}

export default newAccounts
